import Header from '../components/Header';
import {useState, useEffect} from "react";
import {guitar} from "../data/instruments.js"

const baseURL = "https://comp2140.uqcloud.net/api/";
const apiKey = "Q9vUXvhPOt";

function Preview({ previewing, setPreviewing, toneObject, toneTransport }) {

  function handleButtonClick() {

      toneObject.start();
      toneTransport.stop();

      if(previewing) {
          setPreviewing(false);
          console.log("Preview stopped manually.");
      }
      else {
          setPreviewing(true);
          console.log("Preview started.");
          toneTransport.start();
      }

  }

  return <button className="bright-button" onClick={handleButtonClick}>{previewing ? "Stop Previewing" : "Preview"}</button>;

}

